window.bookSummaryJSON = "<p>Overwhelmed by a shift to a \"normal\" life, Nate is under pressure to make friends. Rejoining the immersive fantasy game <i>Fair Quest</i> seems like his best option. But the game has changed, and many players are taking what is going on more personally. Will the return of the Kingmaker winner send shock waves through the game, even as he's trying to avoid attention? Find out in <i>The Rise of Chess</i>.</p> <p>A GameLit coming-of-age story. Book two of Fair Quest.</p>"; 
